import { NgModule } from '@angular/core';
import { CommonModule } from '@angular/common';
import { PostsComponent } from './components/posts/posts.component';



@NgModule({
  declarations: [
    PostsComponent
  ],
  imports: [
    CommonModule
  ],
  exports
})
export class PostsModule { }
